        public static string readToString(string fileName)
        {
            FileStream fs = new FileStream(fileName, FileMode.OpenOrCreate);
            StreamReader sr = new StreamReader(fs, Encoding.GetEncoding("gb2312"));

            string re = sr.ReadToEnd();
            sr.Close();
            fs.Close();
            fs.Dispose();
            return re;
        }

